import React from "react";
import styled from "styled-components";
const Header = () => {
  return (
    <Wrapper>
      <h1>MasRunner</h1>
      <button>Log in</button>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1rem;
`;
export default Header;
